import React from 'react'

function AppNav() {
    return (
        <div className={'appNav'}>
            <span className={'appNav__item'}> Skeleton </span>
            <span className={'appNav__item'}> Both </span>
            <span className={'appNav__item'}> React-Reveal </span>
        </div>
    )
}

export default AppNav
